import React from 'react';
import { Link } from 'react-router-dom';

const Nav = () => {
    return (
        <nav className='navbar'>
            <span className='navbar__clase'>x</span>
            
            <Link to="/">
                <img 
                    className="eventlogo__logo-image" 
                    src="" 
                    alt="EventPlus Logo" 
                />
            </Link>

            <div className='navbar__items-box'>
                <Link to="/"></Link>
            </div>

        </nav>
    );
};

export default Nav;
